import React, { useState } from 'react';
import '/src/css/UpdateMarksForm.css';
import axios from 'axios';

const UpdateMarksForm = () => {
  const [studentId, setStudentId] = useState('');
  const [marks, setMarks] = useState({
    telugu: '',
    hindi: '',
    english: '',
    maths: '',
    science: '',
    social: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setMarks((prevMarks) => ({
      ...prevMarks,
      [name]: value,
    }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    axios
      .post(`http://localhost:8080/updateMarks/${studentId}`, marks, {
        headers: {
          'Content-Type': 'application/json',
        },
      })
      .then(() => {
        setStudentId('');
        setMarks({
          telugu: '',
          hindi: '',
          english: '',
          maths: '',
          science: '',
          social: '',
        });
        console.log('Marks updated successfully');
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>
          Student ID:
          <input type="number" value={studentId} onChange={(e) => setStudentId(e.target.value)} />
        </label>
        <br />
        <label>
          Telugu:
          <input type="number" name="telugu" value={marks.telugu} onChange={handleChange} />
        </label>
        <br />
        <label>
          Hindi:
          <input type="number" name="hindi" value={marks.hindi} onChange={handleChange} />
        </label>
        <br />
        <label>
          English:
          <input type="number" name="english" value={marks.english} onChange={handleChange} />
        </label>
        <br />
        <label>
          Maths:
          <input type="number" name="maths" value={marks.maths} onChange={handleChange} />
        </label>
        <br />
        <label>
          Science:
          <input type="number" name="science" value={marks.science} onChange={handleChange} />
        </label>
        <br />
        <label>
          Social:
          <input type="number" name="social" value={marks.social} onChange={handleChange} />
        </label>
        <br />
        <button type="submit">Update Marks</button>
      </form>
    </div>
  );
};

export default UpdateMarksForm;
